import React from 'react';

import Comments from './coments';

export default class Post extends React.Component{
    constructor(props){
        super(props);

        this.state = {

          Comments:[
            {text:"bacalhau"}
          ]


        }
    };

  render(){
    return(
    <div>   
    <h2>{this.props.title}</h2>
    <Comments text="NICE"/>
    <button> GARAI MENOR</button>
    
    </div>
    );
  }
}
